import React from 'react';
import { Link } from 'react-router-dom';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';

const AppBar = () => {
	const [anchorEl, setAnchorEl] = React.useState(null);
	const open = Boolean(anchorEl);
	const handleClick = (event) => {
	  setAnchorEl(event.currentTarget);
	};
	const handleClose = () => {
	  setAnchorEl(null);
	};

	return(
		<div className="App">
			<section id="header">
				<div class="header container">
					<div class="nav-bar">
						<div class="brand">
							<div id="drawing">
								<div className="circle"></div>
							</div>
							<a href="#hero">
								<h1><span>NEMO</span> NTU539</h1>
							</a>

							{/* <img src="https://i.ibb.co/Vwf0DbB/Logo.jpg" border="0"/> */}
						</div>
						<div class="nav-list">
							<div class="hamburger">
								<div class="bar"></div>
							</div>
							<ul>
								<li>
								<Button
									id="basic-button"
									aria-controls="basic-menu"
									aria-haspopup="true"
									aria-expanded={open ? 'true' : undefined}
									onClick={handleClick}
								>
									Dashboard
								</Button>
								<Menu
									id="basic-menu"
									anchorEl={anchorEl}
									open={open}
									onClose={handleClose}
									MenuListProps={{
									'aria-labelledby': 'basic-button',
									}}
								>
									<MenuItem onClick={handleClose}>Profile</MenuItem>
									<MenuItem onClick={handleClose}>My account</MenuItem>
									<MenuItem onClick={handleClose}>Logout</MenuItem>
								</Menu>
								</li>
								<li><a href="#hero" data-after="Home"><Link to="/main">Home</Link></a></li>
								<li><a href="#services" data-after="Service">Intro</a></li>
								<li><a href="#projects" data-after="Projects">Publication</a></li>
								<li><a href="#about" data-after="About">Member</a></li>
								<li><a href="#contact" data-after="Contact">Contact</a></li>
							</ul>
						</div>
					</div>
				</div>
			</section>
		</div>
	)
}
export default AppBar;
